import './App.css';
import Navbar from './components/navbar';
import Counters from './components/nounters';
import React from 'react';

function App() {
	return (
		<React.Fragment>
			<Navbar />
			<div className='container'>
				<Counters />
			</div>
		</React.Fragment>
	);
}

export default App;
